(77, 'Chili Con Carne', 5, 1, '20 mn', '1h30', '- Mettez les haricots à tremper dans l''eau froide 24 h à l''avance.\r\n\r\n- Cuisez les ensuite 1 h dans de l''eau non salée.\r\n\r\n- Coupez les poivrons en lanières, les tomates en rondelles, et émincer l''ail.\r\n\r\n- Dans une cocotte, faites revenir la viande rapidement, ajoutez ensuite, poivrons, tomates, oignons, ail et haricots.\r\n\r\n- Laissez cuire une quinzaine de minutes et ajouter le chili, l''eau, le sel et le poivre ainsi que les graines de carvi écrasées et mélangées à la farine.\r\n\r\n- Remuez bien le tout et laissez encore cuire 1 h à feu moyen.\r\n', 'pour 6 personnes\r\nUtiliser des epices Ducros ou Old el paso, c''est plus facile. Un sachet suffit.', ''),
(80, 'Fish and Chips (la vraie pâte à friture anglaise)', 5, 1, '20 mn', '3-4 mn', '- Mélangez la farine et la bière.\r\n\r\n- Ajoutez le jaune d''oeuf, puis le blanc d''oeuf monté en neige ferme en soulevant la masse pour ne pas le "casser".\r\n\r\n- La pâte à fish and chips est prête. ', 'La vraie recette !!!!', ''),
(81, 'Pizza maison façon Hélène', 5, 2, '30 mn', '30 mn au four', 'Faire une pâte brisée avec la farine, le beurre et le demi verre d’eau. Quand la pâte est prête, garnir le moule, puis mettre ce dernier au réfrigérateur.\r\n\r\nPendant ce temps, faire revenir dans un peu d’huile d’olive la poitrine fumée découpée en petits lardons.\r\n\r\nRetirer les lardons de la poêle, et à la place y faire suer les oignons coupés en morceaux.\r\n\r\nQuand les oignons sont transparents ajouter les tomates coupées en morceaux elles-aussi. Faire réduire les tomates jusqu’à ce qu’il n’y ait plus de liquide, et ajouter les lardons.\r\n\r\nLaisser un peu mijoter le tout.\r\n\r\nSaler et poivrer la garniture (attention au sel, car les lardons risquent d’être salés).\r\n\r\nSortir le moule du réfrigérateur. Étendre sur la pâte le fromage râpé, puis verser la garniture par dessus, bien étaler la garniture et faire cuire à four chaud 25 à 30 minutes.\r\n\r\nPrendre une boite d’anchois à l’huile que l’on arrange en rayons et mettre des olives noires. Je préfère mettre les anchois et olives lorsque la pizza est cuite.\r\n\r\nQuand on réchauffe la pizza, mettre un filet d’huile d’olive.\r\n\r\nSi on ne dispose pas de tomates fraiches, utiliser deux boites de tomates pelées bien égouttées.\r\n\r\nAttention c’est long à préparer.', 'La vraie pizza de mamie.\r\nUne pâte brisée toute faite, c''est plus rapide et ça marche aussi :)\r\n2 boites de tomates pelées remplacent aussi le kg de tomates si ce n''est pas la saison.', ''),
(82, 'Pintade à la normande', 5, 3, '10 mn', '1 heure', 'Préparation de la pintade\r\n\r\nPréparer la pintade puis la piquer sur toute sa surface,\r\n\r\nDans une cocotte, mettre le beurre à fondre. Dès qu’il est fondu, ajouter un filet d’huile d’olive (1/4) de la quantité de beurre. L’huile d’olive empêchera le beurre de noircir.\r\n\r\nMettre la pintade et la faire revenir sous toutes ses faces.\r\n\r\nLorsqu’elle est correctement dorée, baisser à feux très doux et mettre une moitié de verre d’eau\r\n(7,5 cl). Mettre un couvercle et laisser cuire 45 minutes à 1 h en fonction de la taille de la\r\npintade. tourner la pintade régulièrement pour qu''elle dore sur tous les cotés et qu''elle n''accroche pas au fond.\r\n\r\n\r\nPréparation des pommes\r\n\r\nLorsque la pintade est à la moitié de sa cuisson, il est temps de penser à cuire les pommes.\r\n\r\nEpluchez les pommes et les couper en 4 à 6 quartiers, en fonction de leur taille.\r\n\r\nMettre les pommes dans un plat micro onde et mettre couvert à 800 w pendant 10 minutes.\r\n\r\nSortir le plat, poivrer, mettre des morceaux de beurre et mélanger doucement pour ne pas casser\r\nles morceaux.\r\n\r\nUne fois ceci fait, il ne reste plus qu’à les dorer. Placer les pommes dans une poil et les faire revenir pendant quelques minutes avec du beurre, à feux fort pour qu’elle dorent. Attention\r\nqu’elles ne brûlent pas.\r\n\r\n\r\nAssemblage du plat\r\n\r\nLa cuisson de la pintade arrive a son terme. Le plat doit contenir le jus de la bête. Sortir la bête, et hors du feu, mettre la crème fraîche, le jus de citron, le sel et le poivre. Mélanger doucement hors du feux toujours.\r\n\r\nDans un plat, mettre la pintade au centre, les pommes autour, et verser la sauce obtenue sur le\r\ntout.', 'Encore une recette de mamie', ''),
(83, 'Champignon à la grec façon Hélène', 4, 0, '10mn', '20mn', 'mélanger le tout.\r\n\r\nfaire cuire 20 minutes avec un couvercle à feu doux.\r\n\r\nenlever la feuille de lauriers après cuisson.\r\n\r\nLaisser refroidir et mettre au réfrigérateur.', 'Servir bien frais.\r\n\r\nLes petits oignons peuvent être remplacés par 5 gros oignons.', ''),
(84, 'Cacafouine, la célèbre recette Camenen', 5, 1, '40 mn', '2 heures', 'Épluchez tout ça (attention c''est long).\r\nPour les courgettes, enlevez la peau une bande sur deux. La peau restante empêche que les\r\nmorceaux ne se désagrègent complètement pendant la cuisson.\r\n\r\nCouper pommes de terre et courgettes en morceaux moyens (ni trop gros ni trop petit, facile quoi),\r\nle poivron en lamelles, les tomates en 6.\r\nCouper les saucisses (des chipolatas de préférence, les grosses saucisses se décomposent\r\nlorsqu''elles cuisent longtemps alors que les chipolatas restent en morceaux) en morceaux de 3 ou 4 cm.\r\n\r\nDans une cocote assez haute, faire revenir les saucisses, histoire de les colorer.\r\n\r\nMettre les légumes, le verre d''eau, l''ail haché fin (une gousse voire plus si affinité ou 1,5 cuillère à café lyophilisé), un peu d''herbe de Provence, 2 cuillères à café de Tabasco, sel et poivre.\r\n\r\nFacile d''ajouter du sel, pas facile de l''enlever, donc saler avec parcimonie.\r\n\r\nLaisser cuire à feu doux pendant 2h. S''il reste vraiment beaucoup de liquide, enlever le couvercle\r\nune demie heure avant la fin. Ça doit quand même rester un peu liquide.\r\n\r\nEt zou, plein la gueule !\r\n\r\nCe plat se congèle très bien :) il suffit de le laisser décongeler tranquillement sans l''aide d''un\r\nmicro onde.', 'A s''en faire exploser le bide !!!!', ''),
(85, 'Crumble aux pommes', 4, 2, '20mn', '45 mn', 'Eplucher et couper les pommes en lamelles.\r\n\r\nLes placer dans un plat de 23 sur 31cm\r\n\r\nArroser les pommes avec le jus de citron et 2 cuillères à soupe de sucre\r\n\r\nMélanger le beurre et la farine jusqu''à l''obstention d''une pâte sableuse puis ajouter le sucre (60h)\r\n\r\nAjouter la mixture obtenue sur les pommes, parsemer de sucre brun.\r\n\r\nFaire cuire 45mn à 200°c', 'Recette originale donnée par la soeur de Morgan qui etait aux USA', ''),
(86, 'Gateau au chocolat d''Elodie', 5, 1, '10mn', '10mn', 'Faire fondre le chocolat et le beurre\r\n\r\nMélanger le sucre, les oeufs et la farine\r\n\r\nAjouter le chocolat et le beurre fondu au mélange\r\n\r\nBien mélanger et verser dans un moule non beurré\r\n\r\nMettre au four 10 mn à 210° (th. 7 ou 8)', 'Le fabuleux gateau facile au chocolat d''Elodie !', ''),
(87, 'Tian De Legumes (Provencale)', 4, 2, '30 mn', '30 à 40 mn', 'Faire cuire à l’eau salée le riz.\r\n\r\nPendant ce temps, faire revenir les oignons et l’ail hachés pendant 5 minutes dans une poêle avec un peu d’huile.\r\n\r\nAjouter les viandes bien hachées dans la poêle (enlever la couenne du lard). Faire revenir ensemble dans un peu d’huile pendant 10 à 15 minutes. Saler, poivrer.\r\n\r\nPendant ce temps, éplucher les aubergines, les couper en tranches ou en morceaux et les faire frire à l’huile. Saler, poivrer. Une autre méthode de cuisson consiste à poser une aubergine non peluchée sur une assiette dans le micro onde avec un verre d''eau a coté. Faire cuire 3 mn à pleine puissance. Faire cette opération avec les deux aubergines et les couper en tranches sans se brûler. \r\n\r\nMonter le gratin dans un plat à gratin de la façon suivante : une couche de riz auquel on aura ajouter le râpé ; une couche de viande sur le riz, puis une couche d’aubergines; le reste du riz, de la viande et des aubergines dans cet ordre. Sur le dessus, étaler des tranches de tomates pour recouvrir tout le gratin et finir par du fromage.\r\n\r\nMettre au four 30 à 40 minutes à 180° C.', 'Proportions pour 6 personnes', ''),
(88, 'La fouasse d''Axel', 3, 1, '10 mn', '1 heure', 'Bien mélanger tous les ingrédients jusqu''à obtenir une pâte homogène\r\n\r\nEtaler sur la plaque de cuisson farinée\r\n\r\nCuisson : Thermostat 5-6 pendant 1 heure au moins (ajouter 1/4 heure ou 1/2 heure si besoin)', 'la recette d''Axel', ''),
(89, 'Paupiettes de veau flambées au Cognac', 5, 2, '30 mn', '20 + 25 mn', 'Bien faire revenir les paupiettes dans une cocotte.\r\n\r\nRéservez-les et faites dorer les échalotes dans le jus de paupiettes.\r\n\r\nUne fois les échalotes bien dorées, remettez les paupiettes dans la cocotte, et versez un verre de cognac, dans la cocotte bouillante.\r\n\r\nLes faire flamber (attention aux mèches rebelles ou barbes trop longues !).\r\n\r\nRajoutez le vin blanc et une cuillère à café de fond de veau pour épaissir la sauce.\r\n\r\nAjoutez la crème fraîche, le persil et les champignons et laissez cuire à feu doux et en couvrant la cocotte pendant 20 mn.\r\n\r\nAvant de servir remettez votre cocotte à chauffer à feu doux et couverte pendant 25 mn.\r\n\r\nAccompagnez de pâtes ou de riz. Les brocolis se marient bien aussi avec.', 'Marmiton', ''),
(90, 'Vin chaud aux épices', 5, 1, '5 mn', '15 mn', 'Râpez les zestes des citrons.\r\n\r\nVersez le vin dans une casserole et ajoutez-lui les zestes, le sucre et les épices. Portez à ébullition, coupez le feu et couvrez.\r\n\r\nLaissez infuser 30 minutes puis réchauffez.\r\n\r\nFiltrez et servez.', 'Marmiton', ''),
(79, 'Gnocchis à la façon de ma maman', 5, 2, '30mn', '10mn', 'Les gnocchis\r\nfaire cuire les pommes de terre épluchées. les passer au moulin à légumes.\r\nQjouter les oeufs et mélanger.\r\nAjouter autant de farine en travaillant la masse de purée.\r\nRouler des cylindres de 2cm de diamètre et de longueur 3 à 4 cm.\r\nLes plonger à mesure dans de l''eau bouillante salée avec un filet d''huile.\r\nLaisser cuire et lorsque les gnocchis remontent à la surface, les retirer avec une écumoire.\r\nLes tenir au chaud.\r\n\r\nPour la sauce\r\nFaire suer trois oignons émincés.\r\nAjouter une grande boite de tomates pelées (ou deux kg de tomates fraiches)\r\nAjouter deux boites de sauce à la viande (2 fois 190g)\r\nMixer le tout\r\nAjouter tout le jus d''un roti de porc.\r\n\r\nVerser la sauce sur les gnocchis avec du fromage rapé (pleins)', 'La recette traditionnelle de maman', ''),
(74, 'La pâte à galettes de blé noir traditionnelle', 3, 1, '20 mn', '3-4 mn', 'Dans un saladier, mélanger la farine et le gros sel.\r\n\r\nA l''aide d''un fouet, verser l''eau en deux ou trois fois, tout en mélangeant la préparation. On obtient une pâte lisse et épaisse à laquelle on ajoute un oeuf pour donner une belle coloration à la cuisson.\r\n\r\nFilmer et laisser reposer 1 à 2 heures au réfrigérateur.\r\n\r\nGraisser la crêpière avec une coton imbibé d''huile. Verser une louche de pâte, attendre que la galette colore pour la décoller à l''aide d''une spatule et la retourner. La laisser cuire encore 1 mn environ.\r\n\r\nPour une galette complète, beurrer généreusement les deux côtés de la galette et déposer au centre de l''un des deux, du jambon et de l''emmental râpé, puis casser un oeuf au centre de la galette.\r\n\r\nUne fois qu''il commence à cuire, saler, poivrer et rabattre les bords de la galette de façon à ne laisser paraître que le jaune.\r\n\r\nC''est prêt une fois que l''oeuf est assez cuit.', 'La recette traditionnelle', ''),
(78, 'Riz Cajun Jumbalaya', 5, 2, '30 mn', '1 h 30', '- Mélanger les six premiers ingrédients dans un bol.\r\n\r\n- Faire dorer 5 minutes les lardons et le chorizo avec le beurre.\r\n\r\n- Ajouter les dés de poulet et faire dorer 5 min.\r\n\r\n- Ajouter le mélange aromatique, l''oignon, le céleri,le poivron et l''ail.\r\n\r\n- Faire revenir jusqu''à ce que les légumes soient devenus transparents.\r\n\r\n- Ajouter la sauce tomate, mélanger une minute, puis verser le riz et enfin le bouillon.\r\n\r\n- Mettre dans un plat allant au four et laisser cuire environ 1 heure dans une four à 180° (th 6).', 'Recette de Tabasco. Un délice !!!', ''),
(93, 'Tarte au potiron et à la saucisse de Montbeliard', 3, 2, '30 mn', '40 mn', 'Découpez le potiron en petits dès et mettez les avec le beurre dans une cocotte. Portez à feu doux.\r\n\r\nLorsque la chair du potiron est fondue, retirez le couvercle et augmentez la puissance du feu pour faire évaporer toute l''eau. Ensuite laissez refroidir.\r\n\r\nPréchauffez le four th7 (210°).\r\nEtalez la pâte dans un moule.\r\n\r\nDans un grand bol, battez les oeufs avec la crème.\r\nAjouter la purée de potiron et la saucisse coupée en rondelles.\r\n\r\nAssaisonnez de sel, poivre et d''une pincée de noix de muscade.\r\n\r\nVersez la préparation et enfournez pendant 40 minutes.\r\n\r\nDégustez chaud.', 'Pour 4 personnes', ''),
(94, 'Gencive de porc à la cervelle d''agneau', 5, 1, '10 mn pour tuer le porc', 'cru', 'Il est con ce gamin...', 'Le plat d''Adrien', '');
